import React from 'react'
import {
    useHistory
} from 'react-router-dom';

const Navigation = () => {
    let history = useHistory();

    const search = () => {
        history.push('/user/om')
    }

    return (
        <div>
                <button className='searchButton' onClick={search}>Search</button>
                <input className='searchBar' placeholder="Search by Username" />
                <button>
                    <a href="/trending">
                        Trending
                    </a>
                </button>
                     
        </div>
    )
}

export default Navigation;
